const New = () => {
  const materials = {
    lea: "leather",
    cot: "cottone",
  };
  return (
    <div>
      <label>Select Material</label>
     for (const material in materials){
           console.log(`${material}: ${materials[material]}`)
     }
    </div>
  );
};

export default New;
